import React from 'react';
import styled from 'styled-components';
import Catalog from '../../components/desktop/Catalog';
import TopHeader from '../../components/desktop/TopHead';

const Container = styled.div`
  background-color: #008848;
  display: block;
  height: 50px;
  width: 100%;
  position: fixed;
  top: 0;
`;

const TopHead = styled(TopHeader)`
  margin: 0 0 0 250px;
`;

const Logo = styled.div``;

const Header = () => {
  return (
    <Container>
      <Catalog />
      <TopHead />
    </Container>
  );
};

export default Header;
